E_D("replace into `phome_ecms_infotmp_game` values('65','31','http://www.61baobao.com/jianggushi/10127/','0','2012-05-29 22:41:54','捞皮球的故事','2012-05-29 22:41:54','4usky','2','1338302514','','http://www.61baobao.com/common/flash/2011b/05/pic/025.jpg','','0','','http://s.61baobao.com/common/flash/2011b/05/025.swf','667','479','在碧绿的草地上盛开着五颜六色的鲜花，树上结着红红的果子，清澈的小河，红红的太阳。 <br />有一天，四个猴子在河岸上玩皮球，一不小心，把皮球掉进小河里去了，四个猴子急的都跳起来了，这下可怎么办呢？','http://www.61baobao.com/common/flash/2011b/05/dpic/025.jpg','10127','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1VE9IZE5hbFYxWXpOa2JRPT0=','http://s.61baobao.com/common/flash/2011b/05/025.swf','http://www.61baobao.com/common/flash/2011b/05/dpic/025.jpg','http://www.61baobao.com/common/flash/2011b/05/pic/025.jpg','三个月以上','0','0','','0');");
