E_D("replace into `phome_ecms_infotmp_game` values('116','34','http://www.61baobao.com/jianggushi/3276/','0','2012-05-29 22:42:28','周扒皮半夜偷鸡','2012-05-29 22:42:28','4usky','2','1338302548','','http://www.61baobao.com/common/flash/2010/pic/3276.jpg','','0','','http://s.61baobao.com/common/flash/2010/3276.swf','667','479','周扒皮半夜偷鸡 “周扒皮”为了长工们能多干些活，半夜三更起来学鸡叫让长工劳动（卖身契上明文规定：鸡叫就得起床干活劳动），因为以前没有钟表等计时工具，长工们是从鸡叫起床返工日落则收工，周扒皮半夜鸡叫，使得那些长工们提早起床为他披星戴月地劳作。长工们恨死这个“周扒皮”了，最后忍无可忍，还是小长工小宝献计教训了“周扒皮”一顿。','http://www.61baobao.com/common/flash/2010/dpic/3276.jpg','3276','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjNUSHBOZVU1NldYVmpNMlJ0','http://s.61baobao.com/common/flash/2010/3276.swf','http://www.61baobao.com/common/flash/2010/dpic/3276.jpg','http://www.61baobao.com/common/flash/2010/pic/3276.jpg','三个月以上','0','0','','0');");
