E_D("replace into `phome_ecms_infotmp_game` values('125','31','http://www.61baobao.com/jianggushi/10124/','0','2012-05-29 22:42:40','獾貂争肉','2012-05-29 22:42:40','4usky','2','1338302560','','http://www.61baobao.com/common/flash/2011b/05/pic/022.jpg','','0','','http://s.61baobao.com/common/flash/2011b/05/022.swf','667','479','有一天，一只獾和一只貂同时在森林的小路上发现了一块肉。<br />“这是我捡到的。”獾叫喊说。<br />“不，是我捡到的。”貂也叫喊起来。<br />“是我先看见的。”獾发火了。<br />“不对，是我第一个发现的。”貂争抢着说。<br />他们争执不下，难解难分。这时，獾说话了：“这样吧，我们去找狐狸法官，请他给咱们评评理。”','http://www.61baobao.com/common/flash/2011b/05/dpic/022.jpg','10124','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1VE9IZE5ha2wxWXpOa2JRPT0=','http://s.61baobao.com/common/flash/2011b/05/022.swf','http://www.61baobao.com/common/flash/2011b/05/dpic/022.jpg','http://www.61baobao.com/common/flash/2011b/05/pic/022.jpg','三个月以上','0','0','','0');");
