E_D("replace into `phome_ecms_infotmp_game` values('127','31','http://www.61baobao.com/jianggushi/10123/','0','2012-05-29 22:42:40','蝙蝠、荆棘和潜水鸟','2012-05-29 22:42:40','4usky','2','1338302560','','http://www.61baobao.com/common/flash/2011b/05/pic/021.jpg','','0','','http://s.61baobao.com/common/flash/2011b/05/021.swf','667','479','蝙蝠、荆棘、潜水鸟，决定合伙经商。 <br />蝙蝠借了银子入股，荆棘投进自己的衣服，潜水鸟则买了铜投资，然后它们便乘船出发了。 <br />后来遇上大风，船被吹翻，货物全部丧失，它们漂到岸上才得救。 <br />从此以后，潜水鸟为了找铜，钻到水底的深处，总想什么时候可以把铜找回来； <br />蝙蝠怕见债主，白天不敢露面，夜里才出来觅食； <br />荆棘为了寻找自己的衣服，谁从旁边经过，它就把谁的衣服抓住，想要认出自己的衣服来','http://www.61baobao.com/common/flash/2011b/05/dpic/021.jpg','10123','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1VE9IZE5ha1YxWXpOa2JRPT0=','http://s.61baobao.com/common/flash/2011b/05/021.swf','http://www.61baobao.com/common/flash/2011b/05/dpic/021.jpg','http://www.61baobao.com/common/flash/2011b/05/pic/021.jpg','三个月以上','0','0','','0');");
